import React, { Component } from "react";
import "./index.css";
export default class List extends Component {
  render() {
    return (
      <div className="row">
        {this.props.users.map((userObj) => {
          return (
            <div className="card">
              <a
                href={userObj.html_url}
                target="_blank"
                rel="noreferrer"
              >
                <img
                  src={userObj.avatar_url}
                  style={{ width: "100px" }}
                  alt="head_portrait"
                />
              </a>
              <p className="card-text">{userObj.login}</p>
            </div>
          );
        })}
      </div>
    );
  }
}
